import React, { Component } from "react"
import StarRating from "../reservation/StarRating";


class ChangeCar extends Component {

    state = {
        id: -1,
        rentPrice: -1,
        carType: {
            id: -1,
            numberOfSeats: '',
            modelYear: '',
            model: '',
            brand: '',
            carType: ''
        },
        rentService: {
            id: -1,
            name: '',
            adress: '',
            description: ''
        },
        branchOffice: {
            id: -1,
            name: '',
            adress: '',
            city: '',
            rentServiceDTO: {
                id: '',
                adress: '',
                name: '',
                description: ''
            }
        }
    }

    componentDidMount() {

        if (this.props.car) {
            this.setState({
                id: this.props.car.id,
                rentPrice: this.props.car.rentPrice,
                carType: this.props.car.carType,
                rentService: this.props.car.rentService,
                branchOffice: this.props.car.branchOffice
            })
        }

    }

    handleChange = (e) => {
        this.setState({
            [e.target.id]: e.target.value
        })
    }


    handleSubmit = (e) => {
        e.preventDefault();
        if (this.props.izmena) {

            //  this.props.editCarType(this.props.carType.id, this.state);
        }
        else {
            //  this.props.createCarType(this.state);
            this.setState({
                id: -1,
                rentPrice: -1,
                carType: {
                    id: -1,
                    numberOfSeats: '',
                    modelYear: '',
                    model: '',
                    brand: '',
                    carType: ''
                },
                rentService: {
                    id: -1,
                    name: '',
                    adress: '',
                    description: ''
                },
                branchOffice: {
                    id: -1,
                    name: '',
                    adress: '',
                    city: '',
                    rentServiceDTO: {
                        id: '',
                        adress: '',
                        name: '',
                        description: ''
                    }
                }
            })
        }
    }

    deleteCar = (id) => {

        //this.props.deleteCarType(id);

    }

    render() {
        return (
            <div className="card indigo lighten-1">
                <div className="card-content">
                    <div className="card">
                        <div className="card-content">
                            <span className="card-title indigo-text lighten-1 left"><strong>{this.props.car ? this.props.car.id : ''}</strong></span>
                            {this.props.brisanje ?
                                <div>
                                    <StarRating></StarRating>
                                    <span className="card-title right" onClick={() => this.deleteCar(this.props.car.id)}><a class="btn-floating btn-small waves-effect waves-light red"><i>x</i></a></span>

                                </div>
                                :
                                ''
                            }

                            <div className="container">

                                <form className="white" onSubmit={this.handleSubmit} >
                                    <div className="input-field">
                                        <label htmlFor="rentPrice">Cena</label>
                                        <input onChange={this.handleChange} type="text" id='rentPrice' defaultValue={this.props.car.rentPrice} />
                                    </div>
                                    <div class="input-field col s12">
                                        <select onChange={this.handleChange} className="browser-default">
                                            {this.props.carTypes.map(carType => {
                                                return (
                                                    <option selected={carType.id == this.props.car.carType.id} value={carType.id}>{carType.brand} {carType.model} {carType.modelYear}, {carType.carType}, broj sedista: {carType.numberOfSeats}</option>
                                                );
                                            })}
                                        </select>
                                    </div>
                                    <div class="input-field col s12">
                                        <select onChange={this.handleChange} className="browser-default">
                                            {this.props.branchOffices.map(branch => {
                                                return (
                                                    <option selected={branch.id == this.props.car.branchOffice.id} value={branch.id}>{branch.name}, {branch.adress}, {branch.city} </option>
                                                );
                                            })}
                                        </select>
                                    </div>
                                    <div className="input-field">
                                        <button className="btn blue lighten-1 z-depth-0">Azuriraj</button>
                                    </div>
                                </form>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
};

export default ChangeCar;
